    reset() {
      window.grecaptcha.reset();
    },
    render() {
      var me = this;
      if (window.grecaptcha) {
        this.widgetId = window.grecaptcha.render('recaptcha', {
          sitekey: this.sitekey,
          size: 'invisible',
          callback: token => {
            me.$emit('getGoogle', token), this.reset();
          }
        });
      }
    }
  },
  mounted() {
    this.render();
  }
};
